import web3 from './web3';
const abi=[
    { inputs: [], stateMutability: 'nonpayable', type: 'constructor' },
    {
      inputs: [],
      name: 'CandidateCount',
      outputs: [ [Object] ],
      stateMutability: 'view',
      type: 'function'
    },
    {
      inputs: [ [Object] ],
      name: 'candidates',
      outputs: [ [Object], [Object], [Object], [Object], [Object], [Object] ],
      stateMutability: 'view',
      type: 'function'
    },
    {
      inputs: [ [Object], [Object], [Object], [Object] ],
      name: 'createCandidate',
      outputs: [],
      stateMutability: 'nonpayable',
      type: 'function'
    },
    {
      inputs: [],
      name: 'manager',
      outputs: [ [Object] ],
      stateMutability: 'view',
      type: 'function'
    },
    {
      inputs: [],
      name: 'pickWinner',
      outputs: [ [Object] ],
      stateMutability: 'view',
      type: 'function'
    },
    {
      inputs: [],
      name: 'returnNames',
      outputs: [ [Object] ],
      stateMutability: 'view',
      type: 'function'
    },
    {
      inputs: [ [Object] ],
      name: 'vote',
      outputs: [],
      stateMutability: 'nonpayable',
      type: 'function'
    }
  ];
const instance= new web3.eth.Contract(
    abi,
    '0xF429e79e55FAfc0041BD167478b8bDDb890dc934'
);
export default instance;
